import "./News.css";
import { Container, Row, Col } from "react-bootstrap";
import NavBar from "../../components/Navbar/Navbar";
import CardNews from "../../components/Card/CardNews";
import { useEffect } from "react";
import axios from "axios";
function News() {
  useEffect(() => {
    const getPokemon = async () => {
      const response = await axios(
        "https://newsapi.org/v2/top-headlines?country=id&category=technology&apiKey=160115ded7b948d29103ec8a464f79b8"
      );
      const res = await response.articles;
      console.log("ini fetch dari axios", res);
    };
    getPokemon();
  });
  return (
    <>
      <NavBar />
      <Container
        fluid
        style={{ backgroundImage: `url("/images/bg-img.png")` }}
        className="cover"
      >
        <Row className="justify-content-md-center">
          <Col md={9}>
            <h1 className="h1">
              Jaksa Agung Perintahkan Bentuk Tim Khusus Tangani Mafia
              Tanah-Pelabuhan
            </h1>
          </Col>
        </Row>
      </Container>
      <Container>
        <Row>
          <Col md={3} style={{ marginTop: "20px" }}>
            {" "}
            <CardNews />
          </Col>
        </Row>
      </Container>
    </>
  );
}
export default News;
